package com.biz.ex01;

public class MethodSum {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		int intNum1 = 0;
		intNum1 = 50;
		
		System.out.println(retSum(intNum1));

	}
	public static int retSum(int intNum1) {
		intNum1 = intNum1 + 100;
		return intNum1;
		
	}

}
